    false,nt"url": null,nt"notes": "Gridded bathymetry and IKONOS estimated
    depths of the shelf and slope environments of the Northwestern Hawaiian Islands,
    USA within UTM Zone 2. Bottom coverage was achieved in depths between 0 and 5000
    meters. The ASCII includes multibeam bathymetry from the Simrad EM1002, EM120, EM300,
    and EM3002d, and Reson 8101 multibeam sonars collected as of October 2006 by the
    NOAA Coral Reef Ecosystem Division in depths between 20 and 5000 meters. The ASCII
    grid also includes estimated depths derived from high resolution IKONOS satellite
    imagery by the NOAA/NOS/NCCOS/CCMA Remote Sensing Team in shallow water between
    0 and 16 meters.",nt"license_title": null,nt"extras": [{ntt"key":
